import React from 'react'
import '../Stylesheets/nav-bar.css'

const navbar=()=>{
    return(
        <div id='navbar'>
        <div id='logo-field'>
             <div id='logo'>
                    <h1>INSI</h1>
                </div>
        </div>
        </div>
    );
}
export default navbar;
